import React from "react";
import Router from "./router";

function App() {
  function identity<T, U>(value: T, message: U): [U, T] {
    return [message, value];
  }
  console.log('data', identity(1, '222'))
  return (
    <div className="App">
      <Router></Router>
    </div>
  );
}

export default App;
